include_once($__appvar["basedir"]."/html/rapport/rapportVertaal.php");

class RapportFRONTC_L75
{
	function RapportFRONTC_L75($pdf, $portefeuille, $rapportageDatumVanaf, $rapportageDatum)
	{
		$this->pdf = &$pdf;
		$this->pdf->rapport_type = "FRONT";
		$this->pdf->rapport_datum = db2jul($rapportageDatum);

		if($this->pdf->rapport_OIS_titel)
			$this->pdf->rapport_titel = $this->pdf->rapport_FRONT_titel;
		else
			$this->pdf->rapport_titel = "Titel pagina";

		$this->portefeuille = $portefeuille;
		$this->rapportageDatumVanaf = $rapportageDatumVanaf;
		$this->rapportageDatumVanafJul=db2jul($this->rapportageDatumVanaf);
		$this->rapportageDatum = $rapportageDatum;
		$this->rapportageDatumJul=db2jul($this->rapportageDatum);
		$this->pdf->rapportCounter = count($this->pdf->page);

		$this->DB = new DB();

	}



	function writeRapport()
	{
		global $__appvar;

		$this->pdf->frontPage = true;
    $this->pdf->AddPage('L');
		$this->pdf->frontPage = true;
		if(!$this->pdf->lastPOST['frontWit'])
		  $this->pdf->rect(0,0,297,210,'F','',array($this->pdf->rapport_kop_bgcolor['r'],$this->pdf->rapport_kop_bgcolor['g'],$this->pdf->rapport_kop_bgcolor['b']));

    $logo=base64_decode('');
		$width=100;
		$widthPapier=297;

		$this->pdf->memImage($logo,$widthPapier/2-$width/2,50,$width);

		//echo $this->pdf->rapport_logo;exit;
		//$this->pdf->Image('/develop/php/robert/AIRS/html/rapport/logo/val_logo_alpha.png',20,20,50);


   	$this->pdf->widthA = array(297-$this->pdf->marge*2);
		$this->pdf->alignA = array('C');
    $this->pdf->SetWidths($this->pdf->widthA);
		$this->pdf->SetAligns($this->pdf->alignA);

		$this->pdf->SetFont($this->pdf->rapport_font, 'B', 16);

		$lineWith=100;
		$lineY=130;
		$this->pdf->SetDrawColor($this->pdf->rapport_gold[0],$this->pdf->rapport_gold[1],$this->pdf->rapport_gold[2]);
		$this->pdf->line(297/2-$lineWith/2,$lineY,297/2+$lineWith/2,$lineY);
    $this->pdf->SetY(140);
	  $this->pdf->setTextColor($this->pdf->rapport_kop_fontcolor['r'],$this->pdf->rapport_kop_fontcolor['g'],$this->pdf->rapport_kop_fontcolor['b']);
		if($_POST['anoniem']<>1)
		{
			$this->pdf->row(array($this->pdf->portefeuilledata['Naam']));
		}
		$lineY=150+$this->pdf->rowHeight;
		$this->pdf->line(297/2-$lineWith/2,$lineY,297/2+$lineWith/2,$lineY);
		$rapportagePeriode = date("d",$this->rapportageDatumVanafJul)." ".
		                     vertaalTekst($__appvar["Maanden"][date("n",$this->rapportageDatumVanafJul)],$this->pdf->rapport_taal)." ".
		                     date("Y",$this->rapportageDatumVanafJul).
		                     ' '.vertaalTekst('t/m',$this->pdf->rapport_taal).' '.
		                     date("d",$this->rapportageDatumJul)." ".
		                     vertaalTekst($__appvar["Maanden"][date("n",$this->rapportageDatumJul)],$this->pdf->rapport_taal)." ".
		                     date("Y",$this->rapportageDatumJul);


		/*
		$this->pdf->SetY(133);
		$this->pdf->SetFont($this->pdf->rapport_font,'',$fontsize);
		$this->pdf->row(array('',vertaalTekst('Datum',$this->pdf->rapport_taal).': '.date("j")." ".vertaalTekst($__appvar["Maanden"][date("n")],$this->pdf->rapport_taal)." ".date("Y")));
	*/

	  $this->pdf->SetTextColor($this->pdf->rapport_fontcolor['r'],$this->pdf->rapport_fontcolor['g'],$this->pdf->rapport_fontcolor['b']);
	  $this->pdf->frontPage = true;

   
    $this->pdf->rapport_type = "INHOUD";
	  $this->pdf->rapport_titel = "Inhoudsopgave";//";//Inhoudsopgave
	  $this->pdf->addPage('L');
	  $this->pdf->templateVars['inhoudsPagina']=$this->pdf->page;
		$this->pdf->SetY(25);
		$this->pdf->setTextColor(0);
		$this->pdf->SetDrawColor(0);
		$this->pdf->SetFont($this->pdf->rapport_font, '', $this->pdf->rapport_fontsize+2);
		$this->pdf->row(array(vertaalTekst('Verslagperiode',$this->pdf->rapport_taal)." : ".$rapportagePeriode));
	}
}
